import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Main from "./Main";
export default function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Main language="Home" />}/>
                <Route path="/html" element={<Main language="html" />}/>
                <Route path="/css" element={<Main language="css" />} />
                <Route path="/javascript" element={<Main language="javascript" />} />
            </Routes>
        </BrowserRouter>
    );
}
